DROP TABLE IF EXISTS `T_FF_RT_TASKINSTANCE`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `T_FF_RT_TASKINSTANCE` (
  `ID` varchar(50) NOT NULL,
  `BIZ_TYPE` varchar(250) NOT NULL,
  `TASK_ID` text NOT NULL COMMENT '任务id',
  `ACTIVITY_ID` varchar(200) NOT NULL COMMENT '环节id',
  `NAME` varchar(100) NOT NULL COMMENT '名称',
  `DISPLAY_NAME` varchar(128) DEFAULT NULL COMMENT '名称',
  `STATE` int(11) NOT NULL COMMENT '状态',
  `SUSPENDED` bit(1) NOT NULL COMMENT '是否挂起',
  `TASK_TYPE` varchar(10) DEFAULT NULL COMMENT '任务类型,FormTask,ToolTask,SubflowTask',
  `CREATED_TIME` datetime NOT NULL COMMENT '创建时间',
  `STARTED_TIME` datetime DEFAULT NULL COMMENT '启动时间',
  `EXPIRED_TIME` datetime DEFAULT NULL COMMENT '到期时间',
  `END_TIME` datetime DEFAULT NULL COMMENT '终止时间',
  `ASSIGNMENT_STRATEGY` varchar(10) DEFAULT NULL COMMENT 'WorkItem分配策略,取值ALL,ANY',
  `PROCESSINSTANCE_ID` varchar(50) NOT NULL COMMENT '流程实例id',
  `PROCESS_ID` varchar(100) NOT NULL COMMENT '流程id',
  `VERSION` int(11) NOT NULL COMMENT '流程版本号',
  `TARGET_ACTIVITY_ID` varchar(100) DEFAULT NULL COMMENT '后续activity的id',
  `FROM_ACTIVITY_ID` text COMMENT '前驱activity的id',
  `STEP_NUMBER` int(11) NOT NULL COMMENT '步数',
  `CAN_BE_WITHDRAWN` bit(1) NOT NULL COMMENT '是否可以被撤销',
  PRIMARY KEY (`ID`),
  KEY `idx_taskInst_stepNb` (`STEP_NUMBER`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

